import React from 'react';

class App extends React.Component {
  state = {
    isLoading: true,
    movies: [],
  }

  componentDidMount() {
    axios.get("https://yts-proxy.nomadcoders1.now.sh/list_movies.json");
  }

  render() {
    const {isLoading} = this.state;
    return (<h1>
      {isLoading ? "Loading..." : "We are ready!"}
    </h1>);
  }
}

export default App;
